अपनी Google डिस्क फ़ाइलों के माध्यम से तेज़ी से खोजना चाहते हैं? {{}

सर्वव्यापी खोज का उपयोग करके अपनी Google डिस्क फ़ाइलों के माध्यम से खोजने का एक तेज़ और सरल तरीका है। {२}

आरंभ करने के लिए, कृपया सॉफ़्टवेयर एक्सटेंशन इंस्टॉल करें।
आप ब्राउज़र एक्सटेंशन बार पर जाकर इस एक्सटेंशन का उपयोग करना शुरू कर सकते हैं, ": ड्राइव" में टाइप करें, और फिर वह फ़ाइल नाम जिसे आप खोज रहे हैं।

इसका उपयोग करना आसान है, बस टाइप करें: ड्राइव और फिर आप अपने Google ड्राइव के माध्यम से खोज सकते हैं। {{}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। Google डिस्क के लिए फास्ट सर्च का स्वामित्व नहीं है, यह लाइसेंस प्राप्त नहीं है और यह Google इंक का सहायक नहीं है।
